using SeventhHeavenUI;
using System.Windows;
using System.Windows.Media;

namespace SeventhHeaven.Classes.Themes
{
    public class SeventhHeavenTheme : ITheme
    {
        public string Name { get => "7thHeaven"; }

        public string PrimaryAppBackground
        {
            get
            {
                Color? colorResource = App.Current.TryFindResource("SeventhHeavenBackgroundColor") as Color?;
                return ThemeSettings.ColorToHexString(colorResource.Value);
            }
        }

        public string SecondaryAppBackground
        {
            get
            {
                Color? colorResource = App.Current.TryFindResource("SeventhHeavenSecondaryBackgroundColor") as Color?;
                return ThemeSettings.ColorToHexString(colorResource.Value);
            }
        }

        public string PrimaryControlBackground
        {
            get
            {
                Color? colorResource = App.Current.TryFindResource("SeventhHeavenControlBackground") as Color?;
                return ThemeSettings.ColorToHexString(colorResource.Value);
            }
        }

        public string PrimaryControlForeground
        {
            get
            {
                Color? colorResource = App.Current.TryFindResource("SeventhHeavenControlForeground") as Color?;
                return ThemeSettings.ColorToHexString(colorResource.Value);
            }
        }

        public string PrimaryControlSecondary
        {
            get
            {
                Color? colorResource = App.Current.TryFindResource("SeventhHeavenControlSecondary") as Color?;
                return ThemeSettings.ColorToHexString(colorResource.Value);
            }
        }

        public string PrimaryControlPressed
        {
            get
            {
                Color? colorResource = App.Current.TryFindResource("SeventhHeavenControlPressed") as Color?;
                return ThemeSettings.ColorToHexString(colorResource.Value);
            }
        }

        public string PrimaryControlMouseOver
        {
            get
            {
                Color? colorResource = App.Current.TryFindResource("SeventhHeavenControlMouseOver") as Color?;
                return ThemeSettings.ColorToHexString(colorResource.Value);
            }
        }

        public string PrimaryControlDisabledBackground
        {
            get
            {
                Color? colorResource = App.Current.TryFindResource("SeventhHeavenControlDisabledBackground") as Color?;
                return ThemeSettings.ColorToHexString(colorResource.Value);
            }
        }

        public string PrimaryControlDisabledForeground
        {
            get
            {
                Color? colorResource = App.Current.TryFindResource("SeventhHeavenControlDisabledForeground") as Color?;
                return ThemeSettings.ColorToHexString(colorResource.Value);
            }
        }

        public string BackgroundImageName { get => "7thHeaven Logo"; }
        public string BackgroundImageBase64 { get => ""; }
        public HorizontalAlignment BackgroundHorizontalAlignment { get => HorizontalAlignment.Right; }
        public VerticalAlignment BackgroundVerticalAlignment { get => VerticalAlignment.Bottom; }
        public Stretch BackgroundStretch { get => Stretch.None; }
    }
}
